import React from "react";

const Card = () => {
  return (
    <div>
      <div className="flex m-8">
        <div>
          <img src="./assets/card1.jpg" alt="" />
        </div>
        <div>
          <img src="./assets/card2.jpg" alt="" />
        </div>
        <div>
          <img src="./assets/card3.jpg" alt="" />
        </div>
      </div>
    </div>
  );
};

export default Card;
